<html lang="ko">

        <style>
            html {
                font-size: 10px;
                line-height: 1;
                -webkit-text-size-adjust: 100%;
                -ms-text-size-adjust: 100%;
            }
            body {
                color: #222222;
                background: #fff;
                margin: 0 auto;
                padding: 0;
                font-family: Pretendard, -apple-system, BlinkMacSystemFont, system-ui, Roboto, "Helvetica Neue", "Segoe UI", "Apple SD Gothic Neo", "Noto Sans KR", "Malgun Gothic", sans-serif;
            }
            html,
            h1,
            h2,
            h3,
            h4,
            h5,
            h6,
            form,
            fieldset,
            img {
                margin: 0;
                padding: 0;
                border: 0;
            }
            html,
            input {
                font-family: "Helvetica Neue", Helvetica, Arial, sans-serif;
            }
            .content {
                max-width: 64rem;
                width: 100%;
                height: fit-content;
                display: flex;
                align-items: center;
                justify-content: space-between;
                position: absolute;
                top: 0;
                right: 0;
                left: 0;
                bottom: 0;
                margin: auto;
            }
            .text_wrap {
                max-width: 30rem;
                width: 100%;
            }
            h1 {
                font-size: 11rem;
                font-weight: 400;
                text-align: center;
                margin: 0;
            }
            h2 {
                font-size: 3rem;
                font-weight: 400;
                text-align: center;
                margin: 1rem 0 0;
                white-space: pre-line;
                word-break: keep-all;
            }
            h3 {
                font-size: 1.8rem;
                font-weight: 400;
                text-align: center;
                margin: 3rem 0 0 0;
                line-height: 1.5;
                white-space: pre-line;
                word-break: keep-all;
                height: 8.1rem;
            }
            ul {
                padding: 0 0 0 4rem;
                margin: 1rem 0;
            }

            @media (max-width: 991.99px) {
                .content {
                    top: -5%;
                    flex-direction: column;
                    justify-content: center;
                }
                h1 {
                    font-size: 8rem;
                }
                h2 {
                    font-size: 2rem;
                }
                h3 {
                    font-size: 1.6rem;
                }
                .content img {
                    margin-top: 6rem;
                }
            }
        </style>
